import React, { useState, useEffect } from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import { MinusOutlined, PlusOutlined } from '@ant-design/icons';
import { Grid as GridIcon } from '../../../common/icons';
import { ShapeType } from '../../../common/shapes/types';
import Grid from '../../../common/shapes/Grid';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { Tool } from '../../types';
import './GridTool.scss';

const minCount = 1;
const maxCount = 99;

const GridTool = observer(() => {
  const editing = store.shape.selectedShapes.length === 1 && store.shape.selectedShapes[0].shapeType === ShapeType.GRID;
  const creating = store.config.addMode && store.ontology.currentTool === Tool.GRID;

  const [colsCount, setColsCount] = useState('');
  const [rowsCount, setRowsCount] = useState('');

  useEffect(() => {
    if (editing) {
      const gridShape = store.shape.selectedShapes[0] as Grid;
      setColsCount(`${gridShape.colsCount}`);
      setRowsCount(`${gridShape.rowsCount}`);
    }
  }, [store.instance.selectedInstanceItems, store.frame.loading, store.undo.pointer, store.undo.lastStoreId]);

  useEffect(() => {
    if (creating) {
      const { currentOptions } = store.ontology;
      setColsCount(`${currentOptions.cols}`);
      setRowsCount(`${currentOptions.rows}`);
    }
  }, [store.config.addMode, store.ontology.currentTool]);

  const handleColsChange = (count: string) => {
    const num = Number(count);
    if (num >= minCount && num <= maxCount) {
      setColsCount(`${num}`);
      if (creating) {
        store.ontology.currentOptions.cols = num;
      } else if (editing) {
        const gridShape = store.shape.selectedShapes[0] as Grid;
        gridShape.updateColsCount(num);
      }
    } else if (editing) {
      const gridShape = store.shape.selectedShapes[0] as Grid;
      gridShape.updateColsCount(num);
      setColsCount(`${gridShape.colsCount}`);
    } else {
      setColsCount(`${store.ontology.currentOptions.cols}`);
    }
  };

  const handleRowsChange = (count: string) => {
    const num = Number(count);
    if (num >= minCount && num <= maxCount) {
      setRowsCount(`${num}`);
      if (creating) {
        store.ontology.currentOptions.rows = num;
      } else if (editing) {
        const gridShape = store.shape.selectedShapes[0] as Grid;
        gridShape.updateRowsCount(num);
      }
    } else if (editing) {
      const gridShape = store.shape.selectedShapes[0] as Grid;
      gridShape.updateRowsCount(num);
      setRowsCount(`${gridShape.rowsCount}`);
    } else {
      setRowsCount(`${store.ontology.currentOptions.rows}`);
    }
  };

  const handleMinus = (type: 'col' | 'row') => {
    const num = Number(type === 'col' ? colsCount : rowsCount) - 1;
    if (num >= minCount) {
      const fn = type === 'col' ? handleColsChange : handleRowsChange;
      fn(`${num}`);
    }
  };

  const handlePlus = (type: 'col' | 'row') => {
    const num = Number(type === 'col' ? colsCount : rowsCount) + 1;
    if (num <= maxCount) {
      const fn = type === 'col' ? handleColsChange : handleRowsChange;
      fn(`${num}`);
    }
  };

  const handleInputChange = (value: string, type: 'col' | 'row') => {
    if (!value || /^\d+$/.test(value)) {
      const fn = type === 'col' ? setColsCount : setRowsCount;
      fn(value);
    }
  };

  if (store.readonly || (!editing && !creating)) {
    return null;
  }
  return (
    <div className="grid-tool">
      {creating && (
        <>
          <GridIcon />
          <div className="name">{i18n.translate('TOOL_GRID')}</div>
        </>
      )}
      <div className="divider-sm" />
      <div className="value-label">{i18n.translate('GRID_TOOL_COL')}</div>
      <div className="value-container">
        <MinusOutlined onClick={() => handleMinus('col')} />
        <input
          value={colsCount}
          onChange={(e) => handleInputChange(e.target.value, 'col')}
          onBlur={() => handleColsChange(colsCount)}
          onKeyUp={(e) => {
            if (e.key === 'Enter') {
              handleColsChange(colsCount);
            }
          }}
        />
        <PlusOutlined onClick={() => handlePlus('col')} />
      </div>
      <div className="value-label">{i18n.translate('GRID_TOOL_ROW')}</div>
      <div className="value-container">
        <MinusOutlined onClick={() => handleMinus('row')} />
        <input
          value={rowsCount}
          onChange={(e) => handleInputChange(e.target.value, 'row')}
          onBlur={() => handleRowsChange(rowsCount)}
          onKeyUp={(e) => {
            if (e.key === 'Enter') {
              handleRowsChange(rowsCount);
            }
          }}
        />
        <PlusOutlined onClick={() => handlePlus('row')} />
      </div>
      <div
        className={cx('operation-btn', {
          disabled: creating,
        })}
        style={{ marginLeft: 24, marginRight: 4 }}
        onClick={() => {
          if (editing) {
            const gridShape = store.shape.selectedShapes[0] as Grid;
            gridShape.average();
          }
        }}
      >
        {i18n.translate('GRID_TOOL_AVERAGE')}
      </div>
    </div>
  );
});

export default GridTool;
